import React from 'react'
import './Toogle.css'
import Sun from '@iconscout/react-unicons/icons/uil-sun'
import Moon from '@iconscout/react-unicons/icons/uil-moon'


const Toogle = () => {
  return (
    <div className="toogle">
        <Moon/>
        <Sun/>
    </div>
  )
}

export default Toogle
